def click_link(url_choices, browser, thread_name, stop_thread):
    logging.info("Thread {0} starts".format(thread_name))

    while True:
        try:
            #print("Thread {0} running".format(thread_name))

            #url = url_choices[random.randint(0, len(url_choices) - 1)]
            url = url_choices[0]
            # dr = webdriver.Chrome('/Users/joecheung/PycharmProjects/YellowRibbon/venv/bin/chromedriver')

            if stop_thread():
                logging.info("Thread {0} terminating".format(thread_name))
                return

            if browser == "Safari":
                dr = webdriver.Safari()
            elif browser == "Firefox":
                dr = webdriver.Firefox()
            else:
                print("Invalid browser choice!")
                return

            dr.get(url)
            # print(datetime.datetime.now())
            time.sleep(random.randint(0, 5))
            dr.close()
        except Exception:
            dr.close()
            return


